import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";


const App = () => {


  return (

    <BrowserRouter>
      <Navbar/>
      <Routes>
        <Route path="/" element={<ItemListContainer />}/>
        <Route path="category/:categoryId" element=""/>
        <Route path="product/:productId" element={<ItemDetailContainer/>}/>
        <Route path="/cart" element=""/>


      </Routes>
    </BrowserRouter>


  )
}

export default App
